func cryptoRand(length int) (string, error) {
result := ""
for {
if len(result) >= length {
return result, nil
}

num, err := rand.Int(rand.Reader, big.NewInt(int64(127)))
if err != nil {
return "", err
}

n := num.Int64()

if n > 32 && n < 127 {
result += string(n)
}
}
}

func formatBool(input bool) string {

if input == false {
return "\x1b[31mFalse\x1b[0m"
}

return "\x1b[32mTrue\x1b[0m"
}

